import React, { useEffect } from "react";
import { Box, Stack, Typography } from "@mui/material";
import WebGazer from './WebGazer';
import SpeechReader from "./SpeechReader";

function Interview() {

  return(
    <div>
      <Stack direction="column">
        <Box
          boxShadow={100}
          className="card"
          sx={{
            backgroundColor: "rgba(4,198,223,0.4)",
            color: "white",
            width: '100%'
            // height: "45px",
            // width: "480px",
          }}
        >
          <Typography variant="h5" marginLeft={4} marginTop={1}>
            Model
          </Typography>
        </Box>
      </Stack>
    </div>
  );
};

export default Interview;
